import React from "react";
import {
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    Button,
    Paper,
} from "@mui/material";

const ContactsTable = ({ contacts, onEdit, onDelete }) => {
    return (
        <TableContainer
            component={Paper}
            sx={{
                boxShadow: 2,
                borderRadius: 2,
                margin: "auto",
                mt: 4,
            }}
        >
            <Table>
                <TableHead>
                    <TableRow
                        sx={{
                            backgroundColor: "grey",
                        }}
                    >
                        <TableCell sx={{ fontWeight: "bold", color: 'beige' }}>First Name</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Last Name</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Email</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Phone</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Company</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Job Title</TableCell>
                        <TableCell sx={{ fontWeight: "bold" }}>Actions</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {contacts.map((contact, index) => (
                        <TableRow
                            key={contact.id}
                            sx={{
                                backgroundColor: index % 2 === 0 ? "#ffffff" : "#ffffff", // Alternate row colors
                                "&:hover": {
                                    backgroundColor: "#f1f1f1", // Highlight row on hover
                                },
                            }}
                        >
                            <TableCell>{contact.first_name}</TableCell>
                            <TableCell>{contact.last_name}</TableCell>
                            <TableCell>{contact.email}</TableCell>
                            <TableCell>{contact.phone}</TableCell>
                            <TableCell>{contact.company}</TableCell>
                            <TableCell>{contact.job_title}</TableCell>
                            <TableCell>
                                <Button
                                    onClick={() => onEdit(contact)}
                                    variant="outlined"
                                    size="small"
                                >
                                    Edit
                                </Button>
                                <Button
                                    onClick={() => onDelete(contact.id)}
                                    variant="contained"
                                    color="error"
                                    size="small"
                                    sx={{ ml: 1 }}
                                >
                                    Delete
                                </Button>
                            </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default ContactsTable;
